import React, {Component} from 'react';
import './styles.scss';

class Footer extends Component{
	render(){
		return(
			<div>
				<div className="container">
					<footer>
						<p>&copy; 2019 TERRALOGIC.INC.</p>
					</footer>
				</div>
			</div>
			)
	}
}

export default Footer;
